years=function(e,c,n){for(v="",n;n>=c;n--)v+='<option value="'+n+'">'+n;document.getElementById(e).innerHTML=v};var gameText=function(e,c,n,i){$(function(){n<c.length&&($(e).append(c[n++]),setTimeout(function(){gameText(e,c,n,i)},i))})};__D=new Date,now=function(){var e=new Date;return e.getFullYear()+"-"+(e.getMonth()+1)+"-"+e.getDate()+" "+e.getHours()+":"+e.getMinutes()+":"+e.getSeconds()},later=function(e){var c=new Date;return c.getFullYear()+e+"-"+(c.getMonth()+1)+"-"+c.getDate()+" "+c.getHours()+":"+c.getMinutes()+":"+c.getSeconds()};var setColor=function(e){$("#style_color").attr("href","css/style_"+e+".css")};setColor("gray");